import React, { useEffect, useState } from 'react';
import { motion } from 'framer-motion';
import './DailyMealsDelivered.css';

const DailyMealsDelivered = () => {
  const [scrollY, setScrollY] = useState(0);
  const [sectionTop, setSectionTop] = useState(0);
  const [sectionHeight, setSectionHeight] = useState(0);

  const cards = [
    {
      id: 1,
      title: 'Daily Meals Delivered',
      subtitle: 'Fresh, home-style meals prepared daily',
      description: 'Fresh, home-style meals prepared daily and delivered right to your doorstep. No more planning, shopping, or cooking required.',
      icon: '🍽️',
      color: '#FF6B6B'
    },
    {
      id: 2,
      title: 'Save Your Time',
      subtitle: 'Focus on what matters most',
      description: 'No more planning, shopping, or cooking. We handle everything while you focus on what matters most to you.',
      icon: '⏰',
      color: '#4ECDC4'
    },
    {
      id: 3,
      title: 'Budget-Friendly',
      subtitle: 'Starting at ₹120/day',
      description: 'More affordable than ordering out, with zero waste. Get premium quality meals at unbeatable prices.',
      icon: '💰',
      color: '#45B7D1'
    }
  ];

  useEffect(() => {
    const handleScroll = () => {
      setScrollY(window.scrollY);
    };

    const handleResize = () => {
      const section = document.getElementById('daily-meals-delivered');
      if (section) {
        setSectionTop(section.offsetTop);
        setSectionHeight(section.offsetHeight);
      }
    };

    window.addEventListener('scroll', handleScroll);
    window.addEventListener('resize', handleResize);

    // Initial calculation
    handleResize();

    return () => {
      window.removeEventListener('scroll', handleScroll);
      window.removeEventListener('resize', handleResize);
    };
  }, []);

  const getStickyLinePosition = () => {
    const headerHeight = 80; // Header height
    const subscriptionSection = document.getElementById('subscription-plans');
    if (subscriptionSection) {
      return subscriptionSection.offsetTop + subscriptionSection.offsetHeight + headerHeight;
    }
    return 200; // Fallback
  };

  const getCardTransform = (index) => {
    const stickyLinePos = getStickyLinePosition();
    const cardHeight = 400;
    const stackOffset = 60; // How much of the previous card shows
    const scrollProgress = Math.max(0, scrollY - stickyLinePos);
    const cardTrigger = index * (cardHeight - stackOffset);

    // Check if we've reached the end condition
    const totalStackHeight = cards.length * cardHeight;
    const endTrigger = totalStackHeight - window.innerHeight;

    if (scrollProgress > endTrigger) {
      // Remove sticky behavior and let section scroll normally
      return {
        position: 'relative',
        top: 0,
        zIndex: cards.length - index,
        transform: `translateY(${index * stackOffset}px)`
      };
    }

    if (scrollProgress >= cardTrigger) {
      // Card is sticking
      return {
        position: 'fixed',
        top: `${stickyLinePos - scrollY + (index * stackOffset)}px`,
        zIndex: cards.length - index,
        transform: 'translateY(0)'
      };
    } else {
      // Card hasn't reached sticky position yet
      return {
        position: 'relative',
        top: 0,
        zIndex: cards.length - index,
        transform: `translateY(${Math.max(0, scrollProgress - cardTrigger)}px)`
      };
    }
  };

  return (
    <section id="daily-meals-delivered" className="daily-meals-delivered-section">
      {/* Sticky line indicator */}
      <div className="sticky-line" style={{ top: `${getStickyLinePosition()}px` }}></div>

      <div className="container mx-auto px-4 md:px-6">
        {/* Section Header */}
        <motion.div 
          className="text-center mb-16 pt-20"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.8 }}
        >
          <motion.h2 
            className="text-4xl md:text-5xl font-bold mb-4 text-gray-900 tracking-tight"
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.8, delay: 0.2 }}
          >
            Why Choose <span className="text-primary">Myna Kitchen</span>
          </motion.h2>
          <motion.p 
            className="text-lg text-gray-600 max-w-2xl mx-auto"
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.8, delay: 0.4 }}
          >
            Experience the convenience of fresh, home-style meals delivered daily to your doorstep.
          </motion.p>
        </motion.div>

        {/* Stacking Cards */}
        <div className="stacking-cards-container">
          {cards.map((card, index) => {
            const cardStyle = getCardTransform(index);

            return (
              <motion.div
                key={card.id}
                className="stacking-card"
                style={{
                  ...cardStyle,
                  backgroundColor: card.color,
                  left: '50%',
                  transform: `translateX(-50%) ${cardStyle.transform}`,
                  width: '90%',
                  maxWidth: '600px'
                }}
                initial={{ opacity: 0, y: 50 }}
                whileInView={{ opacity: 1, y: 0 }}
                viewport={{ once: true }}
                transition={{ duration: 0.6, delay: index * 0.2 }}
              >
                <div className="card-content">
                  <div className="card-icon">{card.icon}</div>
                  <h3 className="card-title">{card.title}</h3>
                  <p className="card-subtitle">{card.subtitle}</p>
                  <p className="card-description">{card.description}</p>
                </div>

                {/* Card header that shows when stacked */}
                <div className="card-header-overlay">
                  <div className="card-icon-small">{card.icon}</div>
                  <h4 className="card-title-small">{card.title}</h4>
                </div>
              </motion.div>
            );
          })}
        </div>

        {/* Spacer to ensure proper scrolling */}
        <div style={{ height: `${cards.length * 400 + 800}px` }}></div>
      </div>
    </section>
  );
};

export default DailyMealsDelivered;
